88821114/godt_2008_model.kmz","sha256":"MMM0rtztxKakx6e/he4yNxPjecmUvqFfKvM3LyqWiEg="}}}],"impact-text":[{"indexid":"12861331","indexTime":1610429844551,"id":"urn:usgs-product:us:impact-text:usp00040t8:1520609978112","type":"impact-text","code":"usp00040t8","source":"us","updateTime":1520609978112,"status":"UPDATE","properties":{"eventParametersPublicID":"quakeml:US.anss.org/eventParameters/pde19891018000415240_18/1415321102257","eventsource":"us","eventsourcecode":"p00040t8","original-signature":"","original-signature-version":"v1","pdl-client-version":"Version
        1.10.1 2016-04-07","senderemail":""},"preferredWeight":8,"contents":{"":{"contentType":"1","lastModified":1520609978000,"length":5421,"bytes":"<p>\nIn
        the Santa Cruz Mountains in the forest of\nNisene Marks State Park, about
        16 kilometers northeast\nof Santa Cruz and about 7 kilometers south of\nLoma
        Prieta Mountains, California.\n</p>\n<p>\nThis major earthquake\ncaused 63
        deaths, 3,757 injuries, and an\nestimated $6 billion in property damage.\nIt
        was the largest earthquake to occur on\nthe San Andreas fault since the great
        San Francisco\nearthquake in April 1906.\n</p>\n<p>\nThe most severe property
        damage occurred in\nOakland and San Francisco, about 100 kilometer\nnorth
        of the fault segment that slipped on the San Andreas.\nMM intensity IX was
        assigned to San Francisco''s Marina District,\nwhere several houses collapsed,
        and to four areas in\nOakland and San Francisco, where reinforced-concrete
        viaducts collapsed: Nimitz Freeway (Interstate  880)  in\nOakland,  and  Embarcadero
        Freeway, Highway 101,\nand Interstate 280 in San Francisco.\nCommunities sustaining
        heavy damage in the epicentral\narea included Los Gatos, Santa Cruz, and Watsonville.\n</p>\n<p>\nLiquefaction,
        as evidenced by sand boils, lateral\nspreading, settling, and slumping, occurred
        as far as\n110 kilometers from the epicenter. It caused severe damage to\nbuildings
        in San Francisco''s Marina district as\nwell as along the coastal areas of
        Oakland and Alameda\nin the east San Francisco Bay shore area. Liquefaction
        also\ncontributed significantly to the property damage in\nthe Santa Cruz
        and Monterey Bay areas, which lie near\nthe epicentral zone. Structures damaged
        by liquefaction\ninclude buildings, bridges, highways, pipelines,\nport facilities,
        airport runways, and levees.\nSubsurface soil conditions, which amplified
        accelerations\nin the San Francisco Bay area, strongly influenced\nstructural
        damage patterns  and  probably  contributed\nto liquefaction problems in loose,
        sandy fills\nunderlain by deep, cohesive soil deposits.\n</p>\n<p>\nEngineered
        buildings, including those near the epicenter,\nperformed well during the
        earthquake.  Hospital buildings\nin the region sustained only minor system
        and cosmetic\ndamage, and operational interruptions did not occur.\nOnly five
        schools sustained severe damage, estimated at $81 million.\n</p>\n<p>\nMost
        of the spectacular damage to buildings was sustained\nby unreinforced masonry
        buildings constructed of wood-frame\nroof and floor systems supported by unreinforced
        brick walls.\nThese structures failed in areas near the epicenter as well\nas
        in areas far from the epicenter, at San Francisco and\nMonterey. The severe
        shaking near Santa Cruz caused heavy\ndamage to the unreinforced masonry buildings
        in that area,\nparticularly in the Santa Cruz Pacific Garden Mall,\nwhich
        consisted of several blocks of unreinforced masonry\nstore buildings.\n</p>\n<p>\nMore
        than 80 of the 1,500 bridges in the area sustained minor\ndamage, 10 required
        temporary supports, and 10 were closed\nowing to major structural damage.
        One or more spans collapsed on\nthree bridges. The most severe damage occurred
        to older\nstructures  on  poor  ground,  such  as  the Cypress Street\nViaduct
        (41 deaths) and the San Francisco - Oakland Bay Bridge\n(one death). Damage
        to the transportation system was\nestimated at $1.8 billion.\n</p>\n<p>\nMost
        of the more than 1,000 landslides and rockfalls\noccurred in the epicentral
        zone in the Santa Cruz Mountains.\nOne slide, on State Highway 17, disrupted
        traffic for about 1 month.\n</p>\n<p>\nThe earthquake produced a pattern of
        northwest-trending\nextensional fractures in the north end of the aftershock\nzone
        northwest of the epicenter, but through-going\nright-lateral surface faulting
        was not found above\nthe rupture defined by the main shock and its aftershocks.\nSix
        feet of right-lateral strike-slip\nand 4 feet of reverse-slip was inferred
        from geodetic data.\nThe only surface fracturing that might be attributed
        to\nprimary tectonic faulting occurred along a trace of\nthe San Andreas near
        Mount Madonna Road in the Corralitos area,\nwhere en echelon cracks showed
        2 centimeters of right-lateral\ndisplacement.\n</p>\n<p>\nExtensional fractures
        (maximum net displacement of 92 centimeters)\nwere observed about 12 kilometers
        northwest of the epicenter,\nin the Summit Road-Skyland Ridge area, east of
        State Highway 17,\nwhereas zones of compressional deformation were found along\nthe
        northeast foot of the Santa Cruz Mountains between\nBlossom Hill and Palo
        Alto. In Los Altos and Los Gatos,\nground deformation appeared to be associated
        closely\nwith zones of heavy structural damage and broken underground\nutility
        lines.\n</p>\n</p>\n<p>\nOther towns in the area that also experienced severe
        property damage\ninclude Boulder Creek, Corralitos, Hollister, Moss Landing,\nand
        several smaller communities in the Santa Cruz Mountains.\n</p>\n<p>\nThis
        earthquake was felt over most of central California\nand in part of western
        Nevada.\nThe rate of aftershock activity decreased rapidly with time,\nbut
        the total number of aftershocks was less than that expected\nfrom a generic
        California earthquake of similar magnitude.\nFifty-one aftershocks of magnitude
        3.0 and larger occurred\nduring the first day after the main shock,\nand 16
        occurred during the second day.\nAfter 3 weeks, 87 magnitude 3.0 and larger
        aftershocks had occurred.\n</p>\n<p>\n<small>\nAbridged from\nSeismicity of
        the United States, 1568-1989 (Revised),\nby Carl W. Stover and Jerry L. Coffman,\nU.S.
        Geological Survey Professional Paper 1527,\nUnited States Government Printing
        Office, Washington: 1993.\n</small>\n</p> ","sha256":"mxfLTy8PbOqeU7m3HQ1LHFSB4VDP7p+7dXyphaUlEwY="}}},{"indexid":"13408997","indexTime":1610471194072,"id":"urn:usgs-product:us:impact-text:ushis4150:1528145025000","type":"impact-text","code":"ushis4150","source":"us","updateTime":1528145025000,"status":"UPDATE","properties":{"eventParametersPublicID":"quakeml:us.anss.org/eventParameters/ushis4150/1528145025.6935","eventsource":"ushis","eventsourcecode":"4150","original-signature":"","original-signature-version":"v1","pdl-client-version":"Version
